import React from 'react';
import './App.css';
import {Header} from "./components/Header/Header";
import {Navigation} from "./components/Navigation/Navigation";
import {PostType, Profile} from "./components/Profile/Profile";
import {Dialogs} from "./components/Dialogs/Dialogs";
import {BrowserRouter, Route} from "react-router-dom";


export type AppPropsType = {
    posts: Array<PostType>
}


const App = (props:AppPropsType) => {
    let postsData = [
        {id: 1, message: 'Hi, my friend!', likesCount: 11},
        {id: 2, message: 'My first post', likesCount: 12},
    ];

    let DialogsComponent = () => <Dialogs/>
    let ProfileComponent = () => <Profile posts={postsData}/>

    return (
        <BrowserRouter>
            <div className="App">
                <Header/>
                <Navigation/>
                <div className="app-wrapper-content">
                    <Route path="/dialogs" render={DialogsComponent}/>
                    <Route path="/profile" render={ProfileComponent}/>
                    {/*<Route path="/news" component={News}/>*/}
                </div>
            </div>
        </BrowserRouter>
    );
}

export default App;
